import React from 'react'

const ACard = (props) => {
  return (  
    <div className="card-body">
        <h1 className="name">{props.name}</h1>
        <h1 className="date">{props.date}</h1>
        <p>{props.description}</p>
    </div>
  )
}

export default ACard
